import React, { Component } from 'react';
import PropTypes from 'prop-types';
import { Button, FormGroup, FormControl, ControlLabel,Grid,Row,Col } from 'react-bootstrap';
import '../resources/styles/Button.css';
import {Animated} from "react-animated-css";

const RButton = (props) => (
    <div>
      {/*<Button bsStyle="primary" bsClass="button" onClick={props.onClickImplementation}>{props.text}</Button>*/}
      <img src={require('./../resources/images/user.png')} name="home" className="logoutBtn" onClick={props.onClick}/>
    </div>
);

RButton.propTypes = {
    text: PropTypes.string,
    onClickImplementation:PropTypes.func
};

export default RButton;
